const Signup = () => {
  const {handleSubmit} = useForm();
  return (
    <AppLayout>
      <Input name="id"></Input>
      <Input name="nickname"></Input>
      <Input name="password"></Input>
      <Input name="passwordCheck"></Input>
    </AppLayout>
  );
}

export default Signup;
